formdata.description:
downloads": {
              "required": false,
              "description": "List of downloadable files.",
              "type": "array",
              "items": {
                "type": "object",
                "properties": {
                  "id": {
                    "description": "File ID.",
                    "type": "string",
                    "context": [
                      "view",
                      "edit"
                    ]
                  },
                  "name": {
                    "description": "File name.",
                    "type": "string",
                    "context": [
                      "view",
                      "edit"
                    ]
                  },
                  "file": {
                    "description": "File URL.",
                    "type": "string",
                    "context": [
                      "view",
                      "edit"
                    ]
                  }
                }
              }
            },

"stock_status": {
             "required": false,
             "enum": [
               "instock",
               "outofstock",
               "onbackorder"
             ],
             "description": "Controls the stock status of the product.",
             "type": "string"
           },

"backorders": {
              "required": false,
              "enum": [
                "no",
                "notify",
                "yes"
              ],
              "description": "If managing stock, this controls if backorders are allowed.",
              "type": "string"
            },
